import {createRoot} from "react-dom";
import React from "react";

class Myfun extends React.Component{
  constructor(){
    super();

    this.state = {
      a:2,
      b:3
    }
  }


  render(){
    return(<>
    <h1> a :{this.state.a} b: {this.state.b}</h1>
    <button>Swap</button>
    </>);
  }
}

createRoot(document.getElementById("demo")).render(<Myfun/>);
